DROP TABLE IF EXISTS `yg_email_queue`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `yg_email_queue` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `to_email` varchar(255) NOT NULL COMMENT '收件人邮箱',
  `subject` varchar(500) NOT NULL COMMENT '邮件主题',
  `body` longtext NOT NULL COMMENT '邮件内容',
  `type` varchar(50) NOT NULL DEFAULT 'general' COMMENT '邮件类型：activation激活,password_reset密码重置,subscription订阅,expiration到期,order订单,general通用',
  `priority` tinyint(1) NOT NULL DEFAULT '3' COMMENT '优先级：1-5，1最高',
  `status` enum('pending','processing','sent','failed') NOT NULL DEFAULT 'pending' COMMENT '状态：pending待发送,processing处理中,sent已发送,failed失败',
  `retry_count` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '重试次数',
  `max_retries` int(10) unsigned NOT NULL DEFAULT '3' COMMENT '最大重试次数',
  `extra_data` text COMMENT '额外数据JSON格式',
  `error_message` text COMMENT '错误信息',
  `created_at` int(10) unsigned NOT NULL COMMENT '创建时间',
  `updated_at` int(10) unsigned NOT NULL COMMENT '更新时间',
  `scheduled_at` int(10) unsigned NOT NULL COMMENT '计划发送时间',
  `sent_at` int(10) unsigned DEFAULT NULL COMMENT '实际发送时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `idx_status` (`status`) USING BTREE,
  KEY `idx_type` (`type`) USING BTREE,
  KEY `idx_priority` (`priority`) USING BTREE,
  KEY `idx_scheduled_at` (`scheduled_at`) USING BTREE,
  KEY `idx_created_at` (`created_at`) USING BTREE,
  KEY `idx_queue_process` (`status`,`scheduled_at`,`priority`,`created_at`) USING BTREE,
  KEY `idx_cleanup` (`status`,`sent_at`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=2623 DEFAULT CHARSET=utf8 COMMENT='邮件发送队列表';
/*!40101 SET character_set_client = @saved_cs_client */;

